<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="utf-8" />
<style>body{background-color:white;}</style>
<style type="text/css">@layer htmltools {
.html-fill-container {
display: flex;
flex-direction: column;

min-height: 0;
min-width: 0;
}
.html-fill-container > .html-fill-item {

flex: 1 1 auto;
min-height: 0;
min-width: 0;
}
.html-fill-container > :not(.html-fill-item) {

flex: 0 0 auto;
}
}
</style>
<script>(function() {
  // If window.HTMLWidgets is already defined, then use it; otherwise create a
  // new object. This allows preceding code to set options that affect the
  // initialization process (though none currently exist).
  window.HTMLWidgets = window.HTMLWidgets || {};

  // See if we're running in a viewer pane. If not, we're in a web browser.
  var viewerMode = window.HTMLWidgets.viewerMode =
      /\bviewer_pane=1\b/.test(window.location);

  // See if we're running in Shiny mode. If not, it's a static document.
  // Note that static widgets can appear in both Shiny and static modes, but
  // obviously, Shiny widgets can only appear in Shiny apps/documents.
  var shinyMode = window.HTMLWidgets.shinyMode =
      typeof(window.Shiny) !== "undefined" && !!window.Shiny.outputBindings;

  // We can't count on jQuery being available, so we implement our own
  // version if necessary.
  function querySelectorAll(scope, selector) {
    if (typeof(jQuery) !== "undefined" && scope instanceof jQuery) {
      return scope.find(selector);
    }
    if (scope.querySelectorAll) {
      return scope.querySelectorAll(selector);
    }
  }

  function asArray(value) {
    if (value === null)
      return [];
    if ($.isArray(value))
      return value;
    return [value];
  }

  // Implement jQuery's extend
  function extend(target /*, ... */) {
    if (arguments.length == 1) {
      return target;
    }
    for (var i = 1; i < arguments.length; i++) {
      var source = arguments[i];
      for (var prop in source) {
        if (source.hasOwnProperty(prop)) {
          target[prop] = source[prop];
        }
      }
    }
    return target;
  }

  // IE8 doesn't support Array.forEach.
  function forEach(values, callback, thisArg) {
    if (values.forEach) {
      values.forEach(callback, thisArg);
    } else {
      for (var i = 0; i < values.length; i++) {
        callback.call(thisArg, values[i], i, values);
      }
    }
  }

  // Replaces the specified method with the return value of funcSource.
  //
  // Note that funcSource should not BE the new method, it should be a function
  // that RETURNS the new method. funcSource receives a single argument that is
  // the overridden method, it can be called from the new method. The overridden
  // method can be called like a regular function, it has the target permanently
  // bound to it so "this" will work correctly.
  function overrideMethod(target, methodName, funcSource) {
    var superFunc = target[methodName] || function() {};
    var superFuncBound = function() {
      return superFunc.apply(target, arguments);
    };
    target[methodName] = funcSource(superFuncBound);
  }

  // Add a method to delegator that, when invoked, calls
  // delegatee.methodName. If there is no such method on
  // the delegatee, but there was one on delegator before
  // delegateMethod was called, then the original version
  // is invoked instead.
  // For example:
  //
  // var a = {
  //   method1: function() { console.log('a1'); }
  //   method2: function() { console.log('a2'); }
  // };
  // var b = {
  //   method1: function() { console.log('b1'); }
  // };
  // delegateMethod(a, b, "method1");
  // delegateMethod(a, b, "method2");
  // a.method1();
  // a.method2();
  //
  // The output would be "b1", "a2".
  function delegateMethod(delegator, delegatee, methodName) {
    var inherited = delegator[methodName];
    delegator[methodName] = function() {
      var target = delegatee;
      var method = delegatee[methodName];

      // The method doesn't exist on the delegatee. Instead,
      // call the method on the delegator, if it exists.
      if (!method) {
        target = delegator;
        method = inherited;
      }

      if (method) {
        return method.apply(target, arguments);
      }
    };
  }

  // Implement a vague facsimilie of jQuery's data method
  function elementData(el, name, value) {
    if (arguments.length == 2) {
      return el["htmlwidget_data_" + name];
    } else if (arguments.length == 3) {
      el["htmlwidget_data_" + name] = value;
      return el;
    } else {
      throw new Error("Wrong number of arguments for elementData: " +
        arguments.length);
    }
  }

  // http://stackoverflow.com/questions/3446170/escape-string-for-use-in-javascript-regex
  function escapeRegExp(str) {
    return str.replace(/[\-\[\]\/\{\}\(\)\*\+\?\.\\\^\$\|]/g, "\\$&");
  }

  function hasClass(el, className) {
    var re = new RegExp("\\b" + escapeRegExp(className) + "\\b");
    return re.test(el.className);
  }

  // elements - array (or array-like object) of HTML elements
  // className - class name to test for
  // include - if true, only return elements with given className;
  //   if false, only return elements *without* given className
  function filterByClass(elements, className, include) {
    var results = [];
    for (var i = 0; i < elements.length; i++) {
      if (hasClass(elements[i], className) == include)
        results.push(elements[i]);
    }
    return results;
  }

  function on(obj, eventName, func) {
    if (obj.addEventListener) {
      obj.addEventListener(eventName, func, false);
    } else if (obj.attachEvent) {
      obj.attachEvent(eventName, func);
    }
  }

  function off(obj, eventName, func) {
    if (obj.removeEventListener)
      obj.removeEventListener(eventName, func, false);
    else if (obj.detachEvent) {
      obj.detachEvent(eventName, func);
    }
  }

  // Translate array of values to top/right/bottom/left, as usual with
  // the "padding" CSS property
  // https://developer.mozilla.org/en-US/docs/Web/CSS/padding
  function unpackPadding(value) {
    if (typeof(value) === "number")
      value = [value];
    if (value.length === 1) {
      return {top: value[0], right: value[0], bottom: value[0], left: value[0]};
    }
    if (value.length === 2) {
      return {top: value[0], right: value[1], bottom: value[0], left: value[1]};
    }
    if (value.length === 3) {
      return {top: value[0], right: value[1], bottom: value[2], left: value[1]};
    }
    if (value.length === 4) {
      return {top: value[0], right: value[1], bottom: value[2], left: value[3]};
    }
  }

  // Convert an unpacked padding object to a CSS value
  function paddingToCss(paddingObj) {
    return paddingObj.top + "px " + paddingObj.right + "px " + paddingObj.bottom + "px " + paddingObj.left + "px";
  }

  // Makes a number suitable for CSS
  function px(x) {
    if (typeof(x) === "number")
      return x + "px";
    else
      return x;
  }

  // Retrieves runtime widget sizing information for an element.
  // The return value is either null, or an object with fill, padding,
  // defaultWidth, defaultHeight fields.
  function sizingPolicy(el) {
    var sizingEl = document.querySelector("script[data-for='" + el.id + "'][type='application/htmlwidget-sizing']");
    if (!sizingEl)
      return null;
    var sp = JSON.parse(sizingEl.textContent || sizingEl.text || "{}");
    if (viewerMode) {
      return sp.viewer;
    } else {
      return sp.browser;
    }
  }

  // @param tasks Array of strings (or falsy value, in which case no-op).
  //   Each element must be a valid JavaScript expression that yields a
  //   function. Or, can be an array of objects with "code" and "data"
  //   properties; in this case, the "code" property should be a string
  //   of JS that's an expr that yields a function, and "data" should be
  //   an object that will be added as an additional argument when that
  //   function is called.
  // @param target The object that will be "this" for each function
  //   execution.
  // @param args Array of arguments to be passed to the functions. (The
  //   same arguments will be passed to all functions.)
  function evalAndRun(tasks, target, args) {
    if (tasks) {
      forEach(tasks, function(task) {
        var theseArgs = args;
        if (typeof(task) === "object") {
          theseArgs = theseArgs.concat([task.data]);
          task = task.code;
        }
        var taskFunc = tryEval(task);
        if (typeof(taskFunc) !== "function") {
          throw new Error("Task must be a function! Source:\n" + task);
        }
        taskFunc.apply(target, theseArgs);
      });
    }
  }

  // Attempt eval() both with and without enclosing in parentheses.
  // Note that enclosing coerces a function declaration into
  // an expression that eval() can parse
  // (otherwise, a SyntaxError is thrown)
  function tryEval(code) {
    var result = null;
    try {
      result = eval("(" + code + ")");
    } catch(error) {
      if (!(error instanceof SyntaxError)) {
        throw error;
      }
      try {
        result = eval(code);
      } catch(e) {
        if (e instanceof SyntaxError) {
          throw error;
        } else {
          throw e;
        }
      }
    }
    return result;
  }

  function initSizing(el) {
    var sizing = sizingPolicy(el);
    if (!sizing)
      return;

    var cel = document.getElementById("htmlwidget_container");
    if (!cel)
      return;

    if (typeof(sizing.padding) !== "undefined") {
      document.body.style.margin = "0";
      document.body.style.padding = paddingToCss(unpackPadding(sizing.padding));
    }

    if (sizing.fill) {
      document.body.style.overflow = "hidden";
      document.body.style.width = "100%";
      document.body.style.height = "100%";
      document.documentElement.style.width = "100%";
      document.documentElement.style.height = "100%";
      cel.style.position = "absolute";
      var pad = unpackPadding(sizing.padding);
      cel.style.top = pad.top + "px";
      cel.style.right = pad.right + "px";
      cel.style.bottom = pad.bottom + "px";
      cel.style.left = pad.left + "px";
      el.style.width = "100%";
      el.style.height = "100%";

      return {
        getWidth: function() { return cel.getBoundingClientRect().width; },
        getHeight: function() { return cel.getBoundingClientRect().height; }
      };

    } else {
      el.style.width = px(sizing.width);
      el.style.height = px(sizing.height);

      return {
        getWidth: function() { return cel.getBoundingClientRect().width; },
        getHeight: function() { return cel.getBoundingClientRect().height; }
      };
    }
  }

  // Default implementations for methods
  var defaults = {
    find: function(scope) {
      return querySelectorAll(scope, "." + this.name);
    },
    renderError: function(el, err) {
      var $el = $(el);

      this.clearError(el);

      // Add all these error classes, as Shiny does
      var errClass = "shiny-output-error";
      if (err.type !== null) {
        // use the classes of the error condition as CSS class names
        errClass = errClass + " " + $.map(asArray(err.type), function(type) {
          return errClass + "-" + type;
        }).join(" ");
      }
      errClass = errClass + " htmlwidgets-error";

      // Is el inline or block? If inline or inline-block, just display:none it
      // and add an inline error.
      var display = $el.css("display");
      $el.data("restore-display-mode", display);

      if (display === "inline" || display === "inline-block") {
        $el.hide();
        if (err.message !== "") {
          var errorSpan = $("<span>").addClass(errClass);
          errorSpan.text(err.message);
          $el.after(errorSpan);
        }
      } else if (display === "block") {
        // If block, add an error just after the el, set visibility:none on the
        // el, and position the error to be on top of the el.
        // Mark it with a unique ID and CSS class so we can remove it later.
        $el.css("visibility", "hidden");
        if (err.message !== "") {
          var errorDiv = $("<div>").addClass(errClass).css("position", "absolute")
            .css("top", el.offsetTop)
            .css("left", el.offsetLeft)
            // setting width can push out the page size, forcing otherwise
            // unnecessary scrollbars to appear and making it impossible for
            // the element to shrink; so use max-width instead
            .css("maxWidth", el.offsetWidth)
            .css("height", el.offsetHeight);
          errorDiv.text(err.message);
          $el.after(errorDiv);

          // Really dumb way to keep the size/position of the error in sync with
          // the parent element as the window is resized or whatever.
          var intId = setInterval(function() {
            if (!errorDiv[0].parentElement) {
              clearInterval(intId);
              return;
            }
            errorDiv
              .css("top", el.offsetTop)
              .css("left", el.offsetLeft)
              .css("maxWidth", el.offsetWidth)
              .css("height", el.offsetHeight);
          }, 500);
        }
      }
    },
    clearError: function(el) {
      var $el = $(el);
      var display = $el.data("restore-display-mode");
      $el.data("restore-display-mode", null);

      if (display === "inline" || display === "inline-block") {
        if (display)
          $el.css("display", display);
        $(el.nextSibling).filter(".htmlwidgets-error").remove();
      } else if (display === "block"){
        $el.css("visibility", "inherit");
        $(el.nextSibling).filter(".htmlwidgets-error").remove();
      }
    },
    sizing: {}
  };

  // Called by widget bindings to register a new type of widget. The definition
  // object can contain the following properties:
  // - name (required) - A string indicating the binding name, which will be
  //   used by default as the CSS classname to look for.
  // - initialize (optional) - A function(el) that will be called once per
  //   widget element; if a value is returned, it will be passed as the third
  //   value to renderValue.
  // - renderValue (required) - A function(el, data, initValue) that will be
  //   called with data. Static contexts will cause this to be called once per
  //   element; Shiny apps will cause this to be called multiple times per
  //   element, as the data changes.
  window.HTMLWidgets.widget = function(definition) {
    if (!definition.name) {
      throw new Error("Widget must have a name");
    }
    if (!definition.type) {
      throw new Error("Widget must have a type");
    }
    // Currently we only support output widgets
    if (definition.type !== "output") {
      throw new Error("Unrecognized widget type '" + definition.type + "'");
    }
    // TODO: Verify that .name is a valid CSS classname

    // Support new-style instance-bound definitions. Old-style class-bound
    // definitions have one widget "object" per widget per type/class of
    // widget; the renderValue and resize methods on such widget objects
    // take el and instance arguments, because the widget object can't
    // store them. New-style instance-bound definitions have one widget
    // object per widget instance; the definition that's passed in doesn't
    // provide renderValue or resize methods at all, just the single method
    //   factory(el, width, height)
    // which returns an object that has renderValue(x) and resize(w, h).
    // This enables a far more natural programming style for the widget
    // author, who can store per-instance state using either OO-style
    // instance fields or functional-style closure variables (I guess this
    // is in contrast to what can only be called C-style pseudo-OO which is
    // what we required before).
    if (definition.factory) {
      definition = createLegacyDefinitionAdapter(definition);
    }

    if (!definition.renderValue) {
      throw new Error("Widget must have a renderValue function");
    }

    // For static rendering (non-Shiny), use a simple widget registration
    // scheme. We also use this scheme for Shiny apps/documents that also
    // contain static widgets.
    window.HTMLWidgets.widgets = window.HTMLWidgets.widgets || [];
    // Merge defaults into the definition; don't mutate the original definition.
    var staticBinding = extend({}, defaults, definition);
    overrideMethod(staticBinding, "find", function(superfunc) {
      return function(scope) {
        var results = superfunc(scope);
        // Filter out Shiny outputs, we only want the static kind
        return filterByClass(results, "html-widget-output", false);
      };
    });
    window.HTMLWidgets.widgets.push(staticBinding);

    if (shinyMode) {
      // Shiny is running. Register the definition with an output binding.
      // The definition itself will not be the output binding, instead
      // we will make an output binding object that delegates to the
      // definition. This is because we foolishly used the same method
      // name (renderValue) for htmlwidgets definition and Shiny bindings
      // but they actually have quite different semantics (the Shiny
      // bindings receive data that includes lots of metadata that it
      // strips off before calling htmlwidgets renderValue). We can't
      // just ignore the difference because in some widgets it's helpful
      // to call this.renderValue() from inside of resize(), and if
      // we're not delegating, then that call will go to the Shiny
      // version instead of the htmlwidgets version.

      // Merge defaults with definition, without mutating either.
      var bindingDef = extend({}, defaults, definition);

      // This object will be our actual Shiny binding.
      var shinyBinding = new Shiny.OutputBinding();

      // With a few exceptions, we'll want to simply use the bindingDef's
      // version of methods if they are available, otherwise fall back to
      // Shiny's defaults. NOTE: If Shiny's output bindings gain additional
      // methods in the future, and we want them to be overrideable by
      // HTMLWidget binding definitions, then we'll need to add them to this
      // list.
      delegateMethod(shinyBinding, bindingDef, "getId");
      delegateMethod(shinyBinding, bindingDef, "onValueChange");
      delegateMethod(shinyBinding, bindingDef, "onValueError");
      delegateMethod(shinyBinding, bindingDef, "renderError");
      delegateMethod(shinyBinding, bindingDef, "clearError");
      delegateMethod(shinyBinding, bindingDef, "showProgress");

      // The find, renderValue, and resize are handled differently, because we
      // want to actually decorate the behavior of the bindingDef methods.

      shinyBinding.find = function(scope) {
        var results = bindingDef.find(scope);

        // Only return elements that are Shiny outputs, not static ones
        var dynamicResults = results.filter(".html-widget-output");

        // It's possible that whatever caused Shiny to think there might be
        // new dynamic outputs, also caused there to be new static outputs.
        // Since there might be lots of different htmlwidgets bindings, we
        // schedule execution for later--no need to staticRender multiple
        // times.
        if (results.length !== dynamicResults.length)
          scheduleStaticRender();

        return dynamicResults;
      };

      // Wrap renderValue to handle initialization, which unfortunately isn't
      // supported natively by Shiny at the time of this writing.

      shinyBinding.renderValue = function(el, data) {
        Shiny.renderDependencies(data.deps);
        // Resolve strings marked as javascript literals to objects
        if (!(data.evals instanceof Array)) data.evals = [data.evals];
        for (var i = 0; data.evals && i < data.evals.length; i++) {
          window.HTMLWidgets.evaluateStringMember(data.x, data.evals[i]);
        }
        if (!bindingDef.renderOnNullValue) {
          if (data.x === null) {
            el.style.visibility = "hidden";
            return;
          } else {
            el.style.visibility = "inherit";
          }
        }
        if (!elementData(el, "initialized")) {
          initSizing(el);

          elementData(el, "initialized", true);
          if (bindingDef.initialize) {
            var rect = el.getBoundingClientRect();
            var result = bindingDef.initialize(el, rect.width, rect.height);
            elementData(el, "init_result", result);
          }
        }
        bindingDef.renderValue(el, data.x, elementData(el, "init_result"));
        evalAndRun(data.jsHooks.render, elementData(el, "init_result"), [el, data.x]);
      };

      // Only override resize if bindingDef implements it
      if (bindingDef.resize) {
        shinyBinding.resize = function(el, width, height) {
          // Shiny can call resize before initialize/renderValue have been
          // called, which doesn't make sense for widgets.
          if (elementData(el, "initialized")) {
            bindingDef.resize(el, width, height, elementData(el, "init_result"));
          }
        };
      }

      Shiny.outputBindings.register(shinyBinding, bindingDef.name);
    }
  };

  var scheduleStaticRenderTimerId = null;
  function scheduleStaticRender() {
    if (!scheduleStaticRenderTimerId) {
      scheduleStaticRenderTimerId = setTimeout(function() {
        scheduleStaticRenderTimerId = null;
        window.HTMLWidgets.staticRender();
      }, 1);
    }
  }

  // Render static widgets after the document finishes loading
  // Statically render all elements that are of this widget's class
  window.HTMLWidgets.staticRender = function() {
    var bindings = window.HTMLWidgets.widgets || [];
    forEach(bindings, function(binding) {
      var matches = binding.find(document.documentElement);
      forEach(matches, function(el) {
        var sizeObj = initSizing(el, binding);

        var getSize = function(el) {
          if (sizeObj) {
            return {w: sizeObj.getWidth(), h: sizeObj.getHeight()}
          } else {
            var rect = el.getBoundingClientRect();
            return {w: rect.width, h: rect.height}
          }
        };

        if (hasClass(el, "html-widget-static-bound"))
          return;
        el.className = el.className + " html-widget-static-bound";

        var initResult;
        if (binding.initialize) {
          var size = getSize(el);
          initResult = binding.initialize(el, size.w, size.h);
          elementData(el, "init_result", initResult);
        }

        if (binding.resize) {
          var lastSize = getSize(el);
          var resizeHandler = function(e) {
            var size = getSize(el);
            if (size.w === 0 && size.h === 0)
              return;
            if (size.w === lastSize.w && size.h === lastSize.h)
              return;
            lastSize = size;
            binding.resize(el, size.w, size.h, initResult);
          };

          on(window, "resize", resizeHandler);

          // This is needed for cases where we're running in a Shiny
          // app, but the widget itself is not a Shiny output, but
          // rather a simple static widget. One example of this is
          // an rmarkdown document that has runtime:shiny and widget
          // that isn't in a render function. Shiny only knows to
          // call resize handlers for Shiny outputs, not for static
          // widgets, so we do it ourselves.
          if (window.jQuery) {
            window.jQuery(document).on(
              "shown.htmlwidgets shown.bs.tab.htmlwidgets shown.bs.collapse.htmlwidgets",
              resizeHandler
            );
            window.jQuery(document).on(
              "hidden.htmlwidgets hidden.bs.tab.htmlwidgets hidden.bs.collapse.htmlwidgets",
              resizeHandler
            );
          }

          // This is needed for the specific case of ioslides, which
          // flips slides between display:none and display:block.
          // Ideally we would not have to have ioslide-specific code
          // here, but rather have ioslides raise a generic event,
          // but the rmarkdown package just went to CRAN so the
          // window to getting that fixed may be long.
          if (window.addEventListener) {
            // It's OK to limit this to window.addEventListener
            // browsers because ioslides itself only supports
            // such browsers.
            on(document, "slideenter", resizeHandler);
            on(document, "slideleave", resizeHandler);
          }
        }

        var scriptData = document.querySelector("script[data-for='" + el.id + "'][type='application/json']");
        if (scriptData) {
          var data = JSON.parse(scriptData.textContent || scriptData.text);
          // Resolve strings marked as javascript literals to objects
          if (!(data.evals instanceof Array)) data.evals = [data.evals];
          for (var k = 0; data.evals && k < data.evals.length; k++) {
            window.HTMLWidgets.evaluateStringMember(data.x, data.evals[k]);
          }
          binding.renderValue(el, data.x, initResult);
          evalAndRun(data.jsHooks.render, initResult, [el, data.x]);
        }
      });
    });

    invokePostRenderHandlers();
  }


  function has_jQuery3() {
    if (!window.jQuery) {
      return false;
    }
    var $version = window.jQuery.fn.jquery;
    var $major_version = parseInt($version.split(".")[0]);
    return $major_version >= 3;
  }

  /*
  / Shiny 1.4 bumped jQuery from 1.x to 3.x which means jQuery's
  / on-ready handler (i.e., $(fn)) is now asyncronous (i.e., it now
  / really means $(setTimeout(fn)).
  / https://jquery.com/upgrade-guide/3.0/#breaking-change-document-ready-handlers-are-now-asynchronous
  /
  / Since Shiny uses $() to schedule initShiny, shiny>=1.4 calls initShiny
  / one tick later than it did before, which means staticRender() is
  / called renderValue() earlier than (advanced) widget authors might be expecting.
  / https://github.com/rstudio/shiny/issues/2630
  /
  / For a concrete example, leaflet has some methods (e.g., updateBounds)
  / which reference Shiny methods registered in initShiny (e.g., setInputValue).
  / Since leaflet is privy to this life-cycle, it knows to use setTimeout() to
  / delay execution of those methods (until Shiny methods are ready)
  / https://github.com/rstudio/leaflet/blob/18ec981/javascript/src/index.js#L266-L268
  /
  / Ideally widget authors wouldn't need to use this setTimeout() hack that
  / leaflet uses to call Shiny methods on a staticRender(). In the long run,
  / the logic initShiny should be broken up so that method registration happens
  / right away, but binding happens later.
  */
  function maybeStaticRenderLater() {
    if (shinyMode && has_jQuery3()) {
      window.jQuery(window.HTMLWidgets.staticRender);
    } else {
      window.HTMLWidgets.staticRender();

<style type="text/css">
img.leaflet-tile {
padding: 0;
margin: 0;
border-radius: 0;
border: none;
}
.leaflet .info {
padding: 6px 8px;
font: 14px/16px Arial, Helvetica, sans-serif;
background: white;
background: rgba(255,255,255,0.8);
box-shadow: 0 0 15px rgba(0,0,0,0.2);
border-radius: 5px;
}
.leaflet .legend {
line-height: 18px;
color: #555;
}
.leaflet .legend svg text {
fill: #555;
}
.leaflet .legend svg line {
stroke: #555;
}
.leaflet .legend i {
width: 18px;
height: 18px;
margin-right: 4px;
opacity: 0.7;
display: inline-block;
vertical-align: top;

zoom: 1;
*display: inline;

7: Dongbaekdongsan","1948: Ungok Wetland","2225: Sumeunmulbaengdui Ramsar Site","2226: Hanbando Wetland Ramsar Site","2269: Dongcheon Estuary","2448: Janghang Wetland","2540: Mungyeong Doline Wetland","2544: Pyeongdume Wetland"],null,null,{"interactive":false,"permanent":false,"direction":"auto","opacity":1,"offset":[0,0],"textsize":"10px","textOnly":false,"className":"","sticky":true},null]},{"method":"addMarkers","args":[[37.5558333333,35.46289246498684,33.51658494928475,37.22118091125297,33.36530773564484,33.36876712373788,34.88955916167622,34.67324304672972,35.55,38.21666666666667,35.45,33.4,37.7666666667,33.35,37.63383716751613,36.70453994655002,35.14603741504894],[126.928055556,126.6451115211268,126.7170854035056,128.3372404580071,126.4497967514057,126.6923270702486,127.5111199205589,125.3709047978708,128.416666667,128.1166666666667,129.133333333,126.633333333,128.666666667,126.466666667,126.7597387971944,128.2249433532961,126.9593833571944],null,null,"ramsar pts",{"interactive":true,"draggable":false,"keyboard":true,"title":"","alt":"","zIndexOffset":0,"opacity":1,"riseOnHover":false,"riseOffset":250},["2050: <strong>Han River-Bamseom Islets<\/strong><br>\nBiodiv Criteria: 0/4<br>\nEco Services: 5/17 <br>\nHan River-Bamseom Islets. 21/06/12; Seoul; 27 ha; 3732'21\"N 12655'41\"E. A pair of sandy islets of similar size located in the Han River in central Seoul, the only remaining naturally occurring riverine islands in the Han River ecosystem that have not been altered by human settlement. The waters around the islets provide a spawning and nursery ground for a number of Korean indigenous fish species, including the Korean striped bitterling (Acheilognathus yamatsutae), the Korean spined bitterling (Acanthorhodeus gracilis), and the Korean oily shiner (Sarcocheilichthys nigripinnus morii). The site is a centrally located urban wetland that provides a wintering habitat for many common waterfowls, whilst in the summer it provides a breeding ground for a number of species such as Spot-billed Ducks (Anas poecilorhyncha) and the Black-crowned Night Herons (Nycticorax nycticorax). Invasive species such as Red-eared Sliders (Trachemys scripta elegans), hops (Humulus scandens), ragweeds (Ambrosia trifida fo. Integrifolia (Muhl.) Fernald), and one-seeded bur-cucumber (Sicyos angulatus) are seen as potential threats. The islets are protected as an 'Ecosystem and Landscape Region for Conservation' under city legislation. Ramsar Site no. 2050. Most recent RIS information: 2012","1948: <strong>Ungok Wetland<\/strong><br>\nBiodiv Criteria: 1/4<br>\nEco Services: 6/17 <br>\nUngok Wetland. 07/04/2011; North Jeolla Province; 180 ha; 3528'N 12639'E. The whole site is designated as a Wetland Conservation Area and part of the site is an Electric Source Development Area and an Agricultural Conservation Land Area. \r\n\r\nUngok Wetland is located in the southwest part of the Republic of Korea and consists of Ungok Lake and Obaygol low-moor (Obaygol wetland). Obaygol low-moor was used for rice paddy cultivation in the past, and overtime the site was completely abandoned. This site supports important species like the vulnerable Chinese Water Deer (Hydropotes inermis) and Seoul Frog (Pelophylax chosenicus), and \u001cNatural Monument\u001d species such as the Common Kestrel (Falco tinnunculus) and Chinese Goshawk (Accipiter soloensis). \u001cNatural Monuments\u001d are strongly linked to Korean cultural heritage and are consequently protected under national law. Designated as an Electric Source Development Area, the quantity and quality of water is being managed to supply a nuclear power plant. Ungok Wetland is mostly surrounded by natural forest and a Dolmen World Heritage Site is also located here. This site is thought to be the biggest dolmen community in Asia and is thought to be home to human beings who lived by hunting and gathering during prehistoric times. \r\n\r\nThe Department of Nature Environment, Jeonju Regional Environmental Agency and Department of Environment and Hygiene, Gochang-gun Office, is responsible for the management of this site. Ramsar Site no.1947. Most recent RIS information: 2011.","1947: <strong>Dongbaekdongsan<\/strong><br>\nBiodiv Criteria: 2/4<br>\nEco Services: 4/17 <br>\nDongbaekdongsan;14/03/2011; Jeju-do Province; 59ha; 3331'N 12643'E. Nationally-designated Wetland Conservation Area. \r\n\r\nDongbaekdongsan is located on the volcanic island of Jeju, off the southern coast of the Republic of Korea. The site is important for the recharge and conservation of groundwater, as well as for its biodiversity, especially the unique \u0018Gotjawal' forests. The importance of Dongbaekdongsan is mainly due to the mixture of Aa Lava and Pahoehoe Lava rock types that are present at the site. The Aa Lava rocks have crevices and lava tubes, which allows rainwater to seep through and with the Gotjawal forest cover, contribute to a higher rate of groundwater recharge. The groundwater at Dongbaekdongsan is used as one of the many groundwater sources for the approximately half a million people on Jeju Island. The Pahoehoe Lava rocks have however fewer cracks and so are better able to retain rainwater. This leads to the formation of streams, ponds and vernal pools and unlike many other Gotjawal forests, the surface water found in the Dongbaekdongsan forest areas is able to support a range of wildlife. This includes important species like the critically endangered Isoetes sinensis (F: Isoetaceae), the endemic Cheju Salamander (Hynobius quelpartensis) and Mankyua chejuense (F: Ophioglossaceae), a recently discovered genus. It also supports legally protected \u001cNatural Monument\u001d species, which are identified as having some natural heritage value such as the Mandarin Duck (Aix galericulata) and the nationally endangered Boreal Digging Frog (Kaloula borealis). \u001cNatural Monuments\u001d are strongly linked to Korean cultural heritage and are consequently protected under national law. \r\n\r\nThe Department of Environmental Policy and Department of Environmental Management, as part of the Jeju Special Self-Governing Province, is responsible for the management of this site. Ramsar Site no.1948. Most recent RIS information: 2011.","2226: <strong>Hanbando Wetland Ramsar Site<\/strong><br>\nBiodiv Criteria: 2/4<br>\nEco Services: 7/17 <br>\nThe Hanbando Wetland is representative of natural riverine wetlands in the Republic of Korea. The Site, lying in a sand-gravel bar formed in an incised meander, consists of various types of riffles and pools that maintain a rich biodiversity and provide habitats for numerous species including a number of endemic and nationally threatened species. The Site mostly lies on limestone through which groundwater aquifers are formed and recharged. The water that flows through Hanbando Wetland is collected at a nearby water harvesting plant that supplies the majority of drinking water for locals. The wetland has also long supported local agricultural industry. The name Hanbando signifies that the wetland resembles the shape of the Korean Peninsula, which increases the Sites symbolic value.","2225: <strong>Sumeunmulbaengdui Ramsar Site<\/strong><br>\nBiodiv Criteria: 1/4<br>\nEco Services: 6/17 <br>\nSumeunmulbaengdui is a natural mountainous peat wetland on Halla Mountain or 'Hallasan', a shield volcano on Jeju Island and the largest mountain in the Republic of Korea. The Site is unique in the biogeographic region because of its geology and method of formation. It plays an important role in storing and recharging groundwater since Jeju, being a volcanic island, is short of water throughout the year due to irregular precipitation and low infiltration rate. Mostly, water is recharged by groundwater from wetlands, including Sumeunmulbangdui and the three other Ramsar Sites on the island. The geographic features of these Sites are all different: Sumeunmulbangdui is situated on the slope of the volcano, surrounded by six parasitic cones. The Sites bedrock has a high water-retaining capacity and functions as a natural filter. The name Sumeunmulbaengdui which means a field covered with water and hidden by parasitic volcanoes in the local dialect, reflects the rarity of the site and surrounding landscape.","1648: <strong>Mulyeongari-oreum Ramsar Site<\/strong><br>\nBiodiv Criteria: 2/4<br>\nEco Services: 8/17 <br>\n<p>Mulyeongari-oreum is a freshwater crater lake on top of an &ldquo;oreum&rdquo; (parasitic cone) around Halla Mountain on Jeju Island. The island has a total of 368 parasitic cones, of which 91% are scoria cones which are mostly composed of water-permeable basalt. Unlike other scoria cones, the Site retains a plentiful amount of water as weathering of the slopes has led to the accretion of less-permeable, fine-textured soils at the bottom of the crater. Although it is an isolated environment, the Site plays an important role in maintaining biodiversity, as it provides habitats for over 760 species of plants and animals. Among them are the globally vulnerable fairy pitta <em>Pitta nympha<\/em> and some nationally threatened species such as the nationally endangered golden eagle <em>Aquila chrysaetos<\/em> and peregrine falcon <em>Falco peregrinus<\/em>; and the nationally vulnerable cinereous vulture <em>Aegypius monachus<\/em> and boreal digging frog <em>Kaloula borealis.<\/em> It also provides habitat to the Jeju striped field mouse <em>Apodemus chejuensis<\/em>, which is found only on Jeju Island. The Site is also known as &ldquo;Su-ryeong-ak&rdquo; or &ldquo;Suyeongak&rdquo; which means a hill with holy water.<\/p>","2269: <strong>Dongcheon Estuary<\/strong><br>\nBiodiv Criteria: 2/4<br>\nEco Services: 5/17 <br>\nLocated in the south-eastern part of Suncheon City, the Dongcheon Estuary supports vital wintering and stopover habitats for 238 species of birds, of which at least 13 are globally threatened including the critically endangered spoon-billed sandpiper (<i>Eurynorhynchus pygmeus<\/i>), endangered black-faced spoonbill (<i>Platalea minor<\/i>), and far-eastern curlew (<i>Numenius madagascariensis<\/i>). The Site acts as a transition zone between river and marine environments that provide habitat for 848 species of wild flora and fauna, and a rich aquatic biodiversity due to its varying salinity and nutrients and organic detritus in its sediment. Reed and rice fields along both sides of the Dongcheon River provide habitats for a wide range of wild mammals, aquatic insects and amphibians. The rice fields are key for migrating waterbirds such as hooded cranes (<i>Grus monacha<\/i>), and serve as one of the largest wintering grounds for white-naped cranes (<i>Grus vipio<\/i>). The annual number of visitors to the Dongcheon Estuary as well as the adjacent Suncheon Bay Ramsar Site increased from 1.2 million in 2005 to 1.9 million in 2015, about four times the population of Suncheon City. Of the entire area of Dongcheon Estuary, almost 54% is privately owned and the rest of the land is owned by the national government. Only non-commercial fishing activities are allowed and the only commercial activities on the Site are rice production in its paddy fields.","1458: <strong>Jangdo Wetland<\/strong><br>\nBiodiv Criteria: 2/4<br>\nEco Services: 7/17 <br>\nThe Jangdo Wetland is a rare mountainous freshwater marsh situated on Daejangdo island; it is a relatively large wetland given the size of the island. The Site was also designated as a National Wetland Conservation Area in 2004. It is unique and of conservation value as the plant species found there are mostly tropical, even though the island is not located in the tropical climate zone. The Site and the adjacent islands are important stopover sites, mostly during spring and autumn, for 60 migratory bird species on the East Asian-Australasian Flyway. The wetland serves as a major source of drinking water to the population of about 120 people in the island, as well as to its plants and animals. The wetland harbours the largest number of species found in any site on the islands of the Republic of Korea: its 644 species include phytoplankton/zooplankton, benthic invertebrates, insects, amphibians/reptiles, birds, mammals and plants. On the list are the globally vulnerable Chinese egret <i>Egretta eulophotes<\/i> and Styan's grasshopper warbler <i>Locustella pleskei<\/i>, as well as nationally endangered species such as the peregrine falcon <i>Falco peregrinus<\/i> and the Eurasian otter <i>Lutra lutra<\/i>.","934: <strong>Upo  Wetland<\/strong><br>\nBiodiv Criteria: 1/4<br>\nEco Services: 5/17 <br>\nUpo Wetland. 02/03/98; Kyongsangnam-do; 854 ha; 3533'N 12825'E. Nature Conservation Area. A large oxbow lake, small ponds, and marshes comprise the largest undisturbed wetland in the country. Surface water is persistent even in the dry season. The site exhibits high biodiversity, providing important feeding and spawning areas for fish and supporting rare and endangered flora. Many species of birds breed, stage or winter in the area. Human activities include tourism, agriculture, and snail and shellfish harvesting. Ramsar site no. 934. Most recent RIS information: 1997.","898: <strong>The High Moor, Yongneup of Mt. Daeam<\/strong><br>\nBiodiv Criteria: 1/4<br>\nEco Services: 1/17 <br>\nThe High Moor, Yongneup of Mt. Daeam. 28/03/97; Kangwon-do; 106 ha; 3813'N 12807'E. Natural Environment Preservation Area; Natural Ecosystem Conservation Area; Natural Monument Protection Area. Composed of two bogs and surrounded by deciduous broad-leaved forest, the area is the only high moor in the country. Thick layers of peat formed over 4,000 years ago prevent surface water infiltration, creating a specific topography. The site exhibits high species diversity and supports numerous species of rare plants and many newly discovered species of animals. Public access is strictly controlled. Ramsar site no. 898. Most recent RIS information: 1997.","1725: <strong>Moojechineup<\/strong><br>\nBiodiv Criteria: 2/4<br>\nEco Services: 3/17 <br>\nMoojechineup. 20/12/07; Ulsan; 4 ha; 3527'N 12908'E. Wetland Conservation Area. A 10,000-year-old high moor, the oldest in Korea, with well-developed peat layers and slightly acidic surface water. Various rare flora and fauna, including locally and nationally endangered species, have been identified, including a high diversity of insects with some 197 species. The name of the site comes from a ritual praying for rain in the Ulsan area. Ramsar site no. 1725. Most recent RIS information: 2007.","1847: <strong>Muljangori-oreum wetland<\/strong><br>\nBiodiv Criteria: 2/4<br>\nEco Services: 2/17 <br>\n13/10/08; Jeju-do (Island); 63 ha; 3324'N 12636'E. Within National Park and UNESCO World Heritage site and Biosphere Reserve. A volcanic crater lake at above 900m altitude on Jeju Island, with a forest of broad-leaved deciduous trees. On the water-scarce island, the crater lakes on such \u001cparasitic cones\u001d around Mt Hallasan provide an important store of rain water, and this site retains some water even through the dry season. A number of endangered fauna and flora species are present, including Peregrine falcon, Fairy pitta, Black kites, and Black paradise flycatchers, as well as Japanese forest peony (paeonia obovata). It is considered to be one of three holy mountains on the island and is associated with legends of the giant goddess Seolmundae. Only limited human access is permitted to the area. Ramsar site no. 1847. Most recent RIS information: 2009.","1848: <strong>Odaesan National Park Wetlands<\/strong><br>\nBiodiv Criteria: 2/4<br>\nEco Services: 2/17 <br>\n13/10/08; Gwangwon-do; 2 ha; 3748'N 12838'E. National Park. A complex of three small fens at about 1000m altitude on Odaesan mountain, including some of the best conserved peatlands in the country. They are home to a large number of species of flora that are considered to be endangered or at risk, as well as fauna such as Musk deer, Long-tailed goral, and Water deer, all classed by Vulnerable by the IUCN Red List. The site is owned by the state and public access is not permitted. Ramsar site no. 1848. Most recent RIS information: 2009.","1893: <strong>1100 Altitude Wetland<\/strong><br>\nBiodiv Criteria: 2/4<br>\nEco Services: 2/17 <br>\n1100 Altitude Wetland. 12/10/09; Jeju-do (Island); 13 ha; 3321'N 12628'E. Within National Park, UNESCO World Heritage site and Biosphere Reserve. A mountainous wetland consisting of a number of unique freshwater marshes and pools, situated on Jeju Island. As the name suggests, the site is located at 1100m asl within the Mt Halla World Heritage site. The wetland is in an area of low gradient enabling the capture and retention of freshwater, to form small permanent lakes and peat bogs that support diverse floristic assemblages and significant endemism. The site supports 3 threatened bird and one plant species within Korea, as well as a number of mammal, reptile and insect species endemic to Jeju Island. The site is culturally and religiously important to the local communities. Visits to the site are increasing, with 900,000 visitors in 2008. Visitation is managed by Mt Halla Visitor Centre. 1100 Altitude Wetland was designated as a Wetland Protected Area in 2009 and is managed under 3 management plans as part of the World Heritage and Biosphere programs. Ramsar site no. 1893. Most recent RIS information: 2009.","2448: <strong>Janghang Wetland<\/strong><br>\nBiodiv Criteria: 3/4<br>\nEco Services: 6/17 <br>\n<p>This Site is a typical wetland of the Han river estuary, and forms an intertidal zone featuring woody plants and salt marshes. Located next to heavily populated areas in Goyang City, Gyeonggi Province, Janghang Wetland remains healthy due to its national protection status and ongoing conservation efforts. An important ecological process in the Site is the symbiotic relationship between the woody plants such as Korean willow (<em>Salix koreensis<\/em>) and the benthic organisms such as mud crabs (<em>Chiromantes dehaani<\/em>): the complex root networks of the willows provide shelter, while the benthic communities cultivate and cycle material promoting healthy roots for the willows. The Site hosts threatened species including the critically endangered yellow-breasted bunting (<em>Emberiza aureola<\/em>), and the endangered black-faced spoonbill (<em>Platalea minor<\/em>) and narrow-ridged finless porpoise (<em>Neophocaena asiaeorientalis<\/em>). Two species also meet the requirement for Ramsar Criterion 6, which requires greater than 1% of the waterbird biogeographical population documented within the Site: the white-naped crane (<em>Grus vipio<\/em>) and the black-faced spoonbill.<\/p>","2540: <strong>Mungyeong Doline Wetland<\/strong><br>\nBiodiv Criteria: 2/4<br>\nEco Services: 8/17 <br>\n<p>The Site is a small wetland complex of permanent freshwater marshes, karst landscape, small reservoirs and seasonally flooded farmland. It lies near the peak of Mount Gulbong in a &ldquo;doline&rdquo; topography, a natural enclosed depression created by weathering of the limestone-rich landscape. Unlike typical doline formations in the region, the Site maintains a stable water level due to the sedimentation of a weathered limestone soil called &ldquo;terra rossa&rdquo; that slows the rate of drainage. More than 900 species of plants and animals have been recorded at the Site. Some of them are classified as nationally endangered, including the Amur ratsnake (<em>Elaphe schrenckii<\/em>), the common otter (<em>Lutra lutra<\/em>) and the Amur leopard cat (<em>Prionailurus bengalensis euptilurus<\/em>). There are many plant species that are specifically adapted to the limestone-rich alkaline soil, and at least five of them are endemic to the Republic of Korea. There are also 60 species of birds including the globally vulnerable fairy pitta (<em>Pitta nympha<\/em>) and eight other species that are listed as national natural monuments. Many of these birds live in the surrounding forest areas and migrate to the Site during the winter and breeding seasons. The Site is not connected to a river basin but provides sufficient water for rice, apples and magnolia berries to be grown. In 2017, it was designated as a National Wetland Reserve.<\/p>","2544: <strong>Pyeongdume Wetland<\/strong><br>\nBiodiv Criteria: 2/4<br>\nEco Services: 9/17 <br>\n<p>The Site is situated within Mudeungsan National Park, a mountainous national park formed by volcanic activity. The geology of the upper basin ensures that the downstream wetlands are supplied with clean water at a consistent temperature year-round. The Site was once rice paddy fields, but following natural restoration, its mountainous marshes have recovered, with the willows <em>Salix koreensis <\/em>and <em>Salix glandulosa<\/em> as the dominant tree species. The wetlands provide habitat for at least 578 species, which notably include rare plants such as <em>Semiaquilegia adoxoides<\/em>, <em>Lysimachia barystachys<\/em> and <em>Gynostemma pentaphyllum<\/em>, the nationally endangered Eurasian otter (<em>Lutra lutra<\/em>), yellow-throated marten (<em>Martes flavigula<\/em>) and mainland leopard cat (<em>Prionailurus bengalensis<\/em>), and the insect species <em>Agrypnia pagetana<\/em> which is nationally vulnerable. The Site also supports eight species of amphibians, including the largest population of Ueno&rsquo;s brown frog (<em>Rana uenoi<\/em>) of all the Republic of Korea&rsquo;s national parks. This species is also listed as a national indicator species for climate change. The invasive plants <em>Ambrosia artemisiifolia<\/em> and <em>Humulus japonicus<\/em> may disturb the wetland ecosystems and are being managed. Alongside its importance for biodiversity and nutrient cycling, the Site supports recreation, tourism, and scientific and educational activities.<\/p>"],null,null,null,null,{"interactive":false,"permanent":false,"direction":"auto","opacity":1,"offset":[0,0],"textsize":"10px","textOnly":false,"className":"","sticky":true},null]},{"method":"addLayersControl","args":[["OSM","NatGeo","Imagery"],["level3","level4","level5","level6","level7","level8","level12","ramsar polygons","ramsar pts"],{"collapsed":true,"autoZIndex":true,"position":"topright"}]}],"limits":{"lat":[33.1125,45.2208333],"lng":[116.6208333,131.8752967]}},"evals":[],"jsHooks":[]}</script>
